%Module Loading Starts
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
:- use_module(aleph).
:- if(current_predicate(use_rendering/1)).
:- use_rendering(prolog).
:- endif.
:- aleph.
:-style_check(-discontiguous).
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%Module Loading ends

:- aleph_set(i,2).
:- aleph_set(verbosity,0).
:- aleph_set(depth,2).
:- aleph_set(noise,200). 
:- aleph_set(clauselength,4). 
:- aleph_set(minpos,2).

:- modeh(1,has_disease(+id)).
:- modeb(1,has_age(+id,#agegroup)).
:- modeb(1,has_gender(+id,#sex)).
:- modeb(1,has_height(+id,#height)).
:- modeb(1,has_bmi(+id,#bmi)).
:- modeb(1,has_systolic(+id,#syspress)).
:- modeb(1,has_diastolic(+id,#diaspress)).
:- modeb(1,has_cholesterol(+id,#cholesterol)).
:- modeb(1,has_glucose(+id,#glucose)).
:- modeb(1,smoke(+id,#smoke)).
:- modeb(1,exercise(+id,#exercise)).

:- determination(has_disease/1,has_age/2).
:- determination(has_disease/1,has_gender/2).
:- determination(has_disease/1,has_height/2).
:- determination(has_disease/1,has_bmi/2).
:- determination(has_disease/1,has_systolic/2).
:- determination(has_disease/1,has_diastolic/2).
:- determination(has_disease/1,has_cholesterol/2).
:- determination(has_disease/1,has_glucose/2).
:- determination(has_disease/1,smoke/2).
:- determination(has_disease/1,exercise/2).

:-begin_bg.
% type definitions
has_age(young). has_age(middleAge).  has_age(elderly).
has_gender(female). has_gender(male).
has_height(short). has_height(medium). has_height(tall).
has_bmi(underweight). has_bmi(ideal). has_bmi(obese).
has_systolic(lowBP). has_systolic(normal). has_systolic(highBP).
has_diastolic(lowBP). has_diastolic(medium). has_diastolic(highBP).
has_cholesterol(normal). has_cholesterol(high). has_cholesterol(veryHigh).
has_glucose(normal). has_glucose(high). has_glucose(veryHigh).
smoke(no). smoke(yes).
alcohol(no). alcohol(yes).
exercise(no). exercise(yes).


